import React from 'react'

function ButtonQuestion(props) {
    const rotate1 = keyframes`
    from {
      opacity: 0.0;
    }
  
    to {
      opacity: 1.0;
    }
  `;
  const ShowButton1 = styled.div`
    textalign: center;
    width: 100%;
    display: flex;
    flexdirection: row;
    animation: ${rotate1} 2s linear;
  `;

    return (
        <ShowButton1>
          <div
            style={{
              width: "100%",
              flexBasis: "auto",
              justifyContent: "flex-end",
              display: "flex",
            }}
          >
            <Button
              className="nu-btn-question"
              onClick={() => {
                nextQuestionHandler(false, "...");
              }}
            >
              ไม่ใช่
            </Button>
          </div>
          <div
            style={{
              width: "100%",
              flexBasis: "auto",
              justifyContent: "flex-start",
              display: "flex",
            }}
          >
            <Button
              className="nu-btn-question"
              type="primary"
              onClick={() => {
                nextQuestionHandler(true, "...");
              }}
            >
              ใช่
            </Button>
          </div>
        </ShowButton1>
      );
}

export default ButtonQuestion
